package com.knock.model.vo;

public class CampaignRankVO {
	int campaign_idx;
	int user_idx;
	int user_rank;
	
	public CampaignRankVO() {
		// TODO Auto-generated constructor stub
	}
	
	public int getCampaign_idx() {
		return campaign_idx;
	}
	public void setCampaign_idx(int campaign_idx) {
		this.campaign_idx = campaign_idx;
	}
	public int getUser_idx() {
		return user_idx;
	}
	public void setUser_idx(int user_idx) {
		this.user_idx = user_idx;
	}
	public int getUser_rank() {
		return user_rank;
	}
	public void setUser_rank(int user_rank) {
		this.user_rank = user_rank;
	}
	
	
	
	
}
